import React from "react"
import MaterialCard from "./MaterialCard.js"
import coffee_img from '../images/coffee_img.png'
import materialsData from "../materialData.js"


const materialsArray = materialsData.map(material =>
    <MaterialCard imgUrl={require("../assets/materialImage/${material.imgUrl}")} sloganText={material.sloganText} 
    />)

function Home(){
    return(
        <div className="materials">
            <h2>Home</h2>
            {materialsArray}
        </div>
    )
}

export default Home
